import React,{ Component } from "react";
import {Route} from 'react-router-dom'
import Home from './Home/Home'
import TodoList from "./TodosList/TodosList";
import Login from "./Login/Login";
import SignUp from './Login/SignUp'

class MainBody extends Component{

    state={
        loggedIn:false
    }

     changeStateHandler=()=>{
         this.setState({loggedIn:true})

    }

    render(){


        return(<div >

            <Route path="/" exact component={Home}/>
            <Route path="/todosList" render={(props)=><TodoList logged={this.state.loggedIn}></TodoList>}                         ></Route>
            <Route path="/login" render={(props)=><Login click={this.changeStateHandler} ></Login>}               ></Route>
            <Route path="/signup" component={SignUp}></Route>


        </div>) 
    }
} 

export default MainBody
